import React,{Component} from 'react';

class Footer extends Component{
	render(){
		return(
			<>
				<section className="footer">
					<footer className="footer">
			            <p><span className="footer__copyright">&copy;</span>DE-CENTRA-CART</p>
			        </footer>
				</section>
			</>
		);
	}
}

export default Footer;
